><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E6%9D%8E%E9%87%87%E6%BD%AD------------/" target="_blank">李采潭</a>&nbsp;<a href="/s/-Chae-dam------------/" target="_blank">Chae-dam</a>&nbsp;<a href="/s/-Lee------------/" target="_blank">Lee</a>&nbsp;<a href="/s/-%EC%A0%95%EC%97%B0------------/" target="_blank">정연</a>&nbsp;<a href="/s/-%E7%94%B3%E5%A6%8D%E5%AE%87------------/" target="_blank">申妍宇</a>&nbsp;<a href="/s/-Yeon-woo------------/" target="_blank">Yeon-woo</a>&nbsp;<a href="/s/-Sin------------/" target="_blank">Sin</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%EA%B9%80%EB%B9%9B%EB%82%98--------/" target="_blank">김빛나</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/20/" target="_blank">福利</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E9%9F%A9%E5%9B%BD-----------/" target="_blank">韩国</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2019/" target="_blank">2019</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.08.28</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>男主带着女友回家，家里多了个成熟貌美的继母，男主对她有些兴趣，然而父亲对男主的女友更感兴趣，甚至拉着出去打炮，而这一耻事业很快被男主发现，渴望报复的男主和继母，也开始做出了背德之事....&nbsp;</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/100978/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/100942/" data-original="http://pic.douban888.com/upload/vod/2019-08-28/201908281566944089.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">8.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">BD高清</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/100942/">善良的妈妈3</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span>未知</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span>未知</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/20/" target="_blank">福利</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E9%9F%A9%E5%9B%BD-----------/" target="_blank">韩国</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span>未知</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.08.28</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>동거 중인 선영과 준영 커플. 그런데 그들은 몇 달째 방세를 못내 집주인에게 핀잔을 듣는다. 결국 고민 끝에 준영의 아버지 집에 찾아가 도움을 청한다. 그런데 그곳에선 아버지의 새 애인 지영이 그들을 맞이한다. 선영과 준영 커플은 돈을 빌리지 못하고 당분에 그 집에서 </div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/100942/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/94013/" data-original="http://cj.subo8988.com:8988/upload/vod/2019-07-19/201907191563523123.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">2.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">更新至01集</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/94013/">普通攻击是全体二连击，这样的妈妈你喜欢吗</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E8%8C%85%E9%87%8E%E7%88%B1%E8%A1%A3------------/" target="_blank">茅野爱衣</a>&nbsp;<a href="/s/-%E7%9F%B3%E8%B0%B7%E6%98%A5%E8%B4%B5------------/" target="_blank">石谷春贵</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E5%B2%A9%E5%B4%8E%E8%89%AF%E6%98%8E--------/" target="_blank">岩崎良明</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/4/" target="_blank">动漫</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E6%97%A5%E6%9C%AC-----------/" target="_blank">日本</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2019/" target="_blank">2019</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.08.27</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>“小真，接下来就和妈妈一起好好冒险吧”&nbsp;　　被传送到梦寐以求的游戏世界的高中生、大好真人，但不到为什么，溺爱真人的母亲真真子也跟着来了！？&nbsp;　　母亲陪伴的新感觉冒险喜剧开幕！</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/94013/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/60104/" data-original="https://